import React, { Component } from "react";

class Header extends Component {
    render() {
        return (
            <nav>
                <div className="container nav-wrapper">
                    <a className="left brand-logo">Emaily</a>
                    <ul className="right">
                        <li>
                            <a>Login With Google</a>
                        </li>
                    </ul>
                </div>
            </nav>
        );
    }
}

export default Header;
